// @author         SyndiShanX
// @include        https://docs.google.com/*
// ==/UserScript==

var synCss = `
/**
 * @name Sheets Dark
 * @description A Custom Dark Theme for Sheets
 * @author SyndiShanX#4620
 * @version 1.15
*/

:root {
	--theme: Sheets Dark by SyndiShanX;
  --border-primary: #5c5c5c;
	--border-secondary: #c0c0c0;
	/*
		Images are Stored here to improve Loading times, to get the Image Code:
	  Open https://codebeautify.org/image-to-base64-converter in a Browser, Upload the Image,
		Copy the Base64 String, then Replace one of the below Images with url('data:image/png;base64,BASE64_STRING')
	*/
  --123: url('data:image/png;base64,');
  --svgImage: url('data:image/svg+xml;base64,');
  --bgImage: url('data:image/png;base64,');
	--bgDarkness1: url('data:image/png;base64,');
	--bgDarkness2: url('data:image/png;base64,');
	--bgDarkness3: url('data:image/png;base64,')
}

/* Main Background Image */
.docs-title-input, .menu-button {
	background-image: var(--bgImage)!important;
	background-clip: border-box!important;
	background-origin: padding-box!important;
	background-attachment: scroll!important;
	background-repeat: repeat!important;
	background-size: auto!important;
	background-position: left top!important;
}

/* Darkness 1 Background Image */
.123 {
	background-image: var(--bgDarkness1)!important;
	background-clip: border-box!important;
	background-origin: padding-box!important;
	background-attachment: scroll!important;
	background-repeat: repeat!important;
	background-size: auto!important;
	background-position: left top!important;
}

/* Darkness 2 Background Image */
.123 {
	background-image: var(--bgDarkness2)!important;
	background-clip: border-box!important;
	background-origin: padding-box!important;
	background-attachment: scroll!important;
	background-repeat: repeat!important;
	background-size: auto!important;
	background-position: left top!important;
}

/* Darkness 3 Background Image */
#docs-chrome {
	background-image: var(--bgDarkness3)!important;
	background-clip: border-box!important;
	background-origin: padding-box!important;
	background-attachment: scroll!important;
	background-repeat: repeat!important;
	background-size: auto!important;
	background-position: left top!important;
}

/* Scrollbar */
::-webkit-scrollbar {
	border: none!important;
	width: 8px!important;
}
::-webkit-scrollbar-track {
	background: 0 0!important;
	border: none!important;
}
::-webkit-scrollbar-track-piece {
	background: 0 0!important;
	border: none!important;
}
::-webkit-scrollbar-thumb {
	background: rgba(55, 55, 55, 0.5)!important;
	border-radius: 20px!important;
	border: none!important;
}
::-webkit-scrollbar-thumb:hover {
	background: rgba(75, 75, 75, 1)!important;
}

/* Main Tweaks */
.123 {
  background-color: transparent!important;
}
.123 {
  border: 1px solid var(--border-primary)!important;
}
.123 {
  border: 1px solid var(--border-secondary)!important;
}
#docs-chrome, .menu-button, .docs-title-save-label-text, .docs-titlebar-badge {
	color: #fff!important;
}
.123 {
  border-radius: 12px;
}
.docs-gm .docs-material .docs-icon-img, .docs-material-gm-select-dropdown-icon, .docs-gm .docs-material .docs-icon-img:before, .docs-gm .docs-material .docs-icon-img,
.docs-bubble .docs-link-bubble-calendar-event-action-card-component .docs-link-bubble-calendar-attach-document.jfk-button-disabled:active .docs-icon-img,
.docs-bubble .docs-link-bubble-calendar-event-action-card-component .docs-link-bubble-calendar-attach-document.jfk-button-disabled:active .docs-icon-img:before,
#docs-meet-in-editors-entrypointbutton.goog-flat-menu-button-disabled .docs-icon-present-to-all-24,#docs-meet-in-editors-entrypointbutton.goog-flat-menu-button-disabled .docs-icon-videocam-colored-24,
.docs-color-picker-dropdown-icon, .docs-gm-labeled-color-picker-dropdown-icon {
  content: var(--svgImage)!important;
}
`

var head = document.getElementsByTagName('head')[0];
var stylesheet = document.createElement("style");
stylesheet.type = 'text/css'
stylesheet.innerText = synCss
head.appendChild(stylesheet);